import {StyleSheet} from "react-native";

const styles = StyleSheet.create({
    container: {
      flex: 1,
      flexDirection: "column",
    },
    image: {
      alignItems: 'center',
      flex: 1,
    },
    text: {
      color: "grey",
      fontSize: 30,
      fontWeight: "bold"
    }
  });

export const stylesWEB = StyleSheet.create({
    container: {
      flex: 1,
      flexDirection: "column",
      alignItems: "center"
    },
    image: {
      alignItems: 'center',
      flex: 1,
    },
    text: {
      color: "grey",
      fontSize: 30,
      fontWeight: "bold"
    }
  });

export default styles
